onmap:"1",trail_association:"0",enable_kml_download:"0",total_descent_distance:"12795.2",total_vertical:"388.049",total_karma:"0",description:"The Mission woodlot has been painstakingly created by a small group of riders who have built a mountain biker's paradise of twisting ramps, ladders, jumps, and steep descents. The woodlot is on par with the North Shore, some say better.\r\n\r\nYou can't shuttle, so, the hike/bike up and ride down these trails will keep you busy for the day. The hike/ride up the [L=http://www.trailforks.com/trails/skidder/]skidder[/L] trail to [L=http://www.trailforks.com/trails/gold/]Gold[/L] &amp; Crazy Carpenter will take about an hour. But once you get up top, there are lots of sturdy ladders and you'll want to play over and over on the logs, ladders, and jumps. Bring spares, first aid gear, friends, water, and, respect for the local trails.\r\n\r\nThe Woodlot is actually the BC Ministry of Forest woodlot license 0007.  It is managed by the British Columbia Institute of Technology Forest Society.",access_info:"The Woodlot is located on the border of Maple Ridge and Mission. From the the Dewdney Trunk road, turn North at 287 Street and drive or ride up until it turns on 123 Ave. The main trail is washed out old forestry road that climbs up to the power lines then it opens up to a variety of good technical single tracks. It is an area good for all Downhill levels and advanced XC riders.",source_text:"",source_link:"",bounding_polygon:"-122.4200978948349,49.23311845327767 -122.40856940335482,49.24068229424743 -122.41420704957017,49.255416143818636 -122.4315862833929,49.24578421317707 -122.44087211888655,49.24769149122076 -122.44912798611841,49.237719484567506 -122.44284767934857,49.23113681586714 -122.43536574294012,49.22948592458354 -122.42713100406809,49.226818176015996 -122.4200978948349,49.23311845327767",id:"50",nid:"89",country:"3000",region1:"0",prov:"3002",region2:"3004",region3:"3011",city:"3060",bottom:"ridingarea",wos_country:"35",