gacy_tid:"0",highest_trailhead:"780.115",local_association:"0",download_disable:"1",print_disable:"1",confirmid:"0",icon:"0",views:"2564",map_type:"TERRAIN",map_zoom:"13",shuttle:"0",primary_trail_type:"1",total_checkins:"114",total_ridelogs:"193",closed:"0",total_snowreports:"0",snowreport:"0",hidden:"0",showonmap:"1",trail_association:"176",enable_kml_download:"0",total_descent_distance:"7914.74",total_vertical:"540.615",total_karma:"0",description:"The network of trails on Burke is large and complex. Some date back to the logging days in the early 1900's, when it was known as Dollar Mountain. Most of the mountain biking trails are located on the lower half of the mountain, with endpoints on the Coquitlam River, Harper Road and Victoria Drive.\r\n\r\nMany builders have voiced their concerns that publishing detailed maps may put the trails in jeopardy.  The Burke Mountain area is very sensitive for mountain biking use. Because many of the trails are in a provincial park, there is concern that publicizing the numerous trails might jeopardize the current state of affairs. The locations &amp; gps data for Burke trails is therefore hidden.\r\n\r\n&lt;iframe width=&quot;480&quot; height=&quot;274&quot; src=&quot;http://www.youtube.com/embed/NQzA9iwwIN4&quot; frameborder=&quot;0&quot; allowfullscreen&gt;&lt;/iframe&gt;",access_info:"",source_text:"",source_link:"",bounding_polygon:"-122.7450411248432,49.29428640292885,0 -122.7303709158967,49.29670366873975,0 -122.7241831933512,49.31056038705431,0 -122.7233489006349,49.32268756820614,0 -122.7377027839048,49.32947476507625,0 -122.7505276133277,49.31390031791842,0 -122.7447451213898,49.30400703154112,0 -122.7450411248432,49.29428640292885,0 ",id:"52",nid:"238",country:"3000",region1:"0",prov:"3002",region2:"3004",region3:"3663",city:"3260",bottom:"ridingarea",wos_country:"35",wos_prov:"2",wos_city:"107",season_start:null,season_end:null,lift_ticket:null,bike_lifts:null,latitude:"49.312160",longitude:"-122.742839",region_ind